from math import ceil, sqrt

def min_moves_to_reach_sum(n):

    def fun(a):
        if a % 2 == 0:
            return (a // 2 + 1) * (a // 2 + 1)
        else:
            return (a + 1) // 2 * ((a + 3) // 2)
    i = int(sqrt(n)) / 2
    if fun(i - 2) >= n:
        return i - 2
    elif fun(i - 1) >= n:
        return i - 1
    elif fun(i) >= n:
        return i
    elif fun(i + 1) >= n:
        return i + 1
    else:
        return i + 2

